import React, { Component } from 'react';
import { View, Text, ImageBackground } from 'react-native';

export default class Signup extends Component {
    constructor() {
        super();
    }

    render() {
        return (
            <ImageBackground source={ () => require("../assets/signupscreen.png") }>
            </ImageBackground>
        )
    }

}
